import {Container} from 'native-base';
import { DataTable } from 'react-native-paper';

function MyPlants(props) {
  
    return(
        <DataTable striped>
            <DataTable.Header>
                <DataTable.Row>
              <th>Photo</th>
              <th>Name</th>
              <th>Alert</th>
            </DataTable.Row></DataTable.Header>
        </DataTable>
    );
  }
  
  function RiddleRow(props) {
    
    return(
      <Container>
      </Container>
    );
  }
  
  function RiddleData(props) {
  
    return(
      <Container>
      </Container>
    );
  }

export default MyPlants;
